// // import League1Admin from './league1/League1Admin'
// // import OthersAdmin from './others/othersAdmin'
// // import SerieAAdmin from './seriaaadmin/SeriaAAdmin'
// // import LaligaAdmin from './laligapagesadmin/LaligaAdmin'
// import EpleagueAdmin from './eplpagesadmin/EplAdmin'
// // import BundesligaAdmin from './bundesligaAdmin/BundesligaAdmin'

// const AdminDashboard = () => {
//   return (
//     <div>
//       {/* <LaligaAdmin /> */}
//       <EpleagueAdmin />
//       {/* <BundesligaAdmin /> */}
//       {/* <SerieAAdmin /> */}
//       {/* <League1Admin /> */}
//       {/* <OthersAdmin /> */}
//     </div>
//   )
// }

// export default AdminDashboard
import React from 'react';
import { Container, Row, Col, Card, ListGroup, Button } from 'react-bootstrap';
import DateNav from '../components/DateNav';

const AdminDashboard = () => {
  const sidebarItems = [
    'UI Elements',
    'Form elements',
    'Charts',
    'Tables',
    'Icons',
    'User Pages',
    'Error pages',
    'Documentation',
  ];

  const statCards = [
    {
      title: "Today's Bookings",
      value: 4006,
      percent: '10.00%',
      days: '30 days',
      variant: 'primary',
    },
    {
      title: 'Total Bookings',
      value: 61344,
      percent: '22.00%',
      days: '30 days',
      variant: 'dark',
    },
    {
      title: 'Number of Meetings',
      value: 34040,
      percent: '2.00%',
      days: '30 days',
      variant: 'info',
    },
    {
      title: 'Number of Clients',
      value: 47033,
      percent: '0.22%',
      days: '30 days',
      variant: 'danger',
    },
  ];

  return (
    <Container fluid className="p-0" style={{ minHeight: '100vh', backgroundColor: '#f5f7fb' }}>
      <Row noGutters>
        {/* Sidebar */}
        <Col md={2} style={{ backgroundColor: '#4c3ecf', minHeight: '100vh', color: 'white' }}>
          <h5 className="p-3">Dashboard</h5>
          <ListGroup variant="flush">
            {sidebarItems.map((item, index) => (
              <ListGroup.Item
                key={index}
                style={{ backgroundColor: '#4c3ecf', color: 'white', cursor: 'pointer' }}
              >
                {item}
              </ListGroup.Item>
            ))}
          </ListGroup>
        </Col>

        {/* Main Content */}
        <Col md={10} className="p-4">
          {/* Header */}
          <Row className="mb-4 align-items-center justify-content-between">
            <Col>
              <h4>Welcome John</h4>
              <p>
                All systems are running smoothly!{' '}
                <span className="text-primary">You have 3 unread alerts!</span>
              </p>
            </Col>
            <Col md="auto">
              <Button variant="light"><DateNav /></Button>
            </Col>
          </Row>

          {/* Weather & Image Section */}
          <Row className="mb-4">
            <Col md={6}>
              <Card className="p-4">
                <Card.Body className="d-flex align-items-center justify-content-between">
                  <div>
                    <h3>🌤️ 31°C</h3>
                    <p className="mb-0">Chicago, Illinois</p>
                  </div>
                  <img
                    src="https://www.svgrepo.com/show/354141/family-trip.svg"
                    alt="family"
                    height="100"
                  />
                </Card.Body>
              </Card>
            </Col>
          </Row>

          {/* Stats Cards */}
          <Row>
            {statCards.map((card, index) => (
              <Col md={3} className="mb-3" key={index}>
                <Card bg={card.variant} text="white">
                  <Card.Body>
                    <Card.Title>{card.title}</Card.Title>
                    <h3>{card.value}</h3>
                    <small>{card.percent} ({card.days})</small>
                  </Card.Body>
                </Card>
              </Col>
            ))}
          </Row>
        </Col>
      </Row>
    </Container>
  );
};

export default AdminDashboard;
